e,n5e=[...H4e,...Z4e,t5e],s5e=n5e,i5e=[{label:"destination",insertText:"destination",kind:14,format:QCe.QUOTED,type:GCe.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"**Optional**, defaults to the channel name. The destination (queue or exchange) name for this channel. SHOULD only be specified if the channel name differs from the actual destination name, such as when the channel name is not a valid destination name in Anypoint MQ."},conditions:[{targets:[{path:"bindingVersion"}],function:"apilintValueOrArray",params:[["0.0.1"]]}]},{label:"destinationType",insertText:"destinationType",kind:14,format:QCe.QUOTED,type:GCe.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"**Optional**, defaults to `queue`. The type of destination, which MUST be either `exchange` or `queue` or `fifo-queue`. SHOULD be specified to document the messaging model (publish/subscribe, point-to-point, strict message ordering) supported by this channel."},conditions:[{targets:[{path:"bindingVersion"}],function:"apilintValueOrArray",params:[["0.0.1"]]}]},{target:"destinationType",label:"destinationType",insertText:"exchange",kind:12,format:QCe.QUOTED,type:GCe.VALUE,insertTextFormat:2,conditions:[{targets:[{path:"bindingVersion"}],function:"apilintValueOrArray",params:[["0.0.1"]]}]},{target:"destinationType",label:"destinationType",insertText:"queue",kind:12,format:QCe.QUOTED,type:GCe.VALUE,insertTextFormat:2,conditions:[{targets:[{path:"bindingVersion"}],function:"apilintValueOrArray",params:[["0.0.1"]]}]},{target:"destinationType",label:"destinationType",insertText:"fifo-queue",kind:12,format:QCe.QUOTED,type:GCe.VALUE,insertTextFormat:2,conditions:[{targets:[{path:"bindingVersion"}],function:"apilintValueOrArray",params:[["0.0.1"]]}]}],r5e=i5e,o5e=[{label:"destination",insertText:"destination",kind:14,format:QCe.QUOTED,type:GCe.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"**Optional**, defaults to the channel name. The destination (queue or exchange) name for this channel. SHOULD only be specified if the channel name differs from the actual destination name, such as when the channel name is not a valid destination name in Anypoint MQ."},conditions:[{function:"missingField",params:["bindingVersion"]}]},{label:"destinationType",insertText:"destinationType",kind:14,format:QCe.QUOTED,type:GCe.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"**Optional**, defaults to `queue`. The type of destination, which MUST be either `exchange` or `queue` or `fifo-queue`. SHOULD be specified to document the messaging model (publish/subscribe, point-to-point, strict message ordering) supported by this channel."},conditions:[{function:"missingField",params:["bindingVersion"]}]},{target:"destinationType",label:"destinationType",insertText:"exchange",kind:12,format:QCe.QUOTED,type:GCe.VALUE,insertTextFormat:2,conditions:[{function:"missingField",params:["bindingVersion"]}]},{target:"destinationType",label:"destinationType",insertText:"queue",kind:12,format:QCe.QUOTED,type:GCe.VALUE,insertTextFormat:2,conditions:[{function:"missingField",params:["bindingVersion"]}]},{target:"destinationType",label:"destinationType",insertText:"fifo-queue",kind:12,format:QCe.QUOTED,type:GCe.VALUE,insertTextFormat:2,conditions:[{function:"missingField",params:["bindingVersion"]}]}],a5e=o5e,c5e=[...r5e,...a5e,{label:"bindingVersion",insertText:"bindingVersion",kind:14,format:QCe.QUOTED,type:GCe.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"**Optional**, defaults to `0.0.1`. The version of this binding."}},{target:"bindingVersion",label:"0.0.1",insertText:"0.0.1",kind:12,format:QCe.QUOTED_FORCED,type:GCe.VALUE,insertTextFormat:2}],l5e=c5e,p5e=[{target:"destination",docs:"**Optional**, defaults to the channel name. The destination (queue or exchange) name for this channel. SHOULD only be specified if the channel name differs from the actual destination name, such as when the channel name is not a valid destination name in Anypoint MQ."},{target:"destinationType",docs:"**Optional**, defaults to `queue`. The type of destination, which MUST be either `exchange` or `queue` or `fifo-queue`. SHOULD be specified to document the messaging model (publish/subscribe, point-to-point, strict message ordering) supported by this channel."},{target:"bindingVersion",docs:"**Optional**, defaults to `0.1.0`. The version of this binding."},{docs:"#### [Channel Binding Object](https://github.com/asyncapi/bindings/blob/master/anypointmq/README.md#channel-binding-object)\n\nThe Anypoint MQ [Channel Binding Object](https://github.com/asyncapi/spec/blob/master/spec/asyncapi.md#channel-bindings-object) is defined by a [JSON Schema](https://github.com/asyncapi/bindings/blob/master/anypointmq/json_schemas/channel.json), which defines these fields:\n\nField Name | Type | Description\n---|:---:|---\n`destination`       | string | **Optional**, defaults to the channel name. The destination (queue or exchange) name for this channel. SHOULD only be specified if the channel name differs from the actual destination name, such as when the channel name is not a valid destination name in Anypoint MQ.\n`destinationType`          | string | **Optional**, defaults to `queue`. The type of destination, which MUST be either `exchange` or `queue` or `fifo-queue`. SHOULD be specified to document the messaging model (publish/subscribe, point-to-point, strict message ordering) supported by this channel.\n`bindingVersion` | string | **Optional**, defaults to `0.1.0`. The version of this binding.\n\nNote that an Anypoint MQ exchange can only be sent to, not received from. To receive messages sent to an exchange, [an intermediary queue must be defined and bound to the exchange](https://docs.mulesoft.com/mq/mq-understanding#message-exchanges). In this bindings specification, these intermediary queues are not exposed in the AsyncAPI document. Instead, it is simply assumed that whenever messages must be received from an exchange, such an intermediary queue is involved yet invisible in the AsyncAPI document.\n\n**Examples:**\n\nThe following example shows a `channels` object with two channels, the second having a channel binding object for `anypointmq`:\n\n\n\\\nYAML\n```yaml\nchannels:\n  user/signup:\n    description: |\n      This application receives command messages from this channel about users to sign up.\n      Minimal configuration, omitting a channel binding object.\n    publish:\n      #...\n  user/signedup:\n    description: |\n      This application sends events to this channel about users that have signed up.\n      Explicitly provides a channel binding object.\n    bindings:\n      anypointmq:\n        destination:     user-signup-exchg\n        destinationType: exchange\n        bindingVersion:  '0.0.1'\n    subscribe:\n      #...\n```"}],m5e={lint:s5e,completion:l5e,documentation:p5e},d5e=m5e,u5e={code:ULe.NOT_ALLOWED_FIELDS,source:"apilint",message:"Object includes not allowed fields",severity:Jn.DiagnosticSeverity.Error,linterFunction:"allowedFields",linterParams:[["headers","bindingVersion"]],marker:"key",conditions:[{targets:[{path:"bindingVersion"}],function:"apilintValueOrArray",params:[["0.0.1"]]}]},h5e=u5e,f5e={code:ULe.ASYNCAPI2_ANYPOINTMQ_MESSAGE_BINDING_FIELD_HEADERS_TYPE,source:"apilint",message:"headers must be an object or a boolean JSON schema",severity:Jn.DiagnosticSeverity.Error,linterFunction:"apilintElementOrClass",linterParams:[["schema","boolean"]],marker:"value",target:"headers",data:{},conditions:[{targets:[{path:"bindingVersion"}],function:"apilintValueOrArray",params:[["0.0.1"]]}]},g5e=f5e,b5e=[h5e,g5e],E5e=b5e,y5e={code:ULe.NOT_ALLOWED_FIELDS,source:"apilint",message:"Object includes not allowed fields",severity:Jn.DiagnosticSeverity.Error,linterFunction:"allowedFields",linterParams:[["headers","bindingVersion"]],marker:"key",conditions:[{function:"missingField",params:["bindingVersion"]}]},v5e=y5e,S5e={code:ULe.ASYNCAPI2_ANYPOINTMQ_MESSAGE_BINDING_FIELD_HEADERS_TYPE,source:"apilint",message:"headers must be an object or a boolean JSON schema",severity:Jn.DiagnosticSeverity.Error,linterFunction:"apilintElementOrClass",linterParams:[["schema","boolean"]],marker:"value",target:"headers",data:{},conditions:[{function:"missingField",params:["bindingVersion"]}]},O5e=S5e,_5e=[v5e,O5e],A5e=_5e,P5e={code:ULe.ASYNCAPI2_ANYPOINTMQ_MESSAGE_BINDING_FIELD_BINDING_VERSION_TYPE,source:"apilint",message:"'bindingVersion' value must be a string",severity:Jn.DiagnosticSeverity.Error,linterFunction:"apilintType",linterParams:["string"],marker:"value",target:"bindingVersion",data:{}},T5e=P5e,I5e=[...E5e,...A5e,T5e],x5e=I5e,w5e=[{label:"headers",insertText:"headers",kind:14,format:QCe.OBJECT,type:GCe.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"[Schema object](https://www.asyncapi.com/docs/reference/specification/v2.6.0#schemaObject)\n\\\n\\\n**Optional**. A Schema object containing the definitions for Anypoint MQ-specific headers (so-called protocol headers). This schema MUST be of type `object` and have a `properties` key. Examples of Anypoint MQ protocol headers are `messageId` and `messageGroupId`."},conditions:[{targets:[{path:"bindingVersion"}],function:"apilintValueOrArray",params:[["0.0.1"]]}]}],N5e=w5e,R5e=[{label:"headers",insertText:"headers",kind:14,format:QCe.OBJECT,type:GCe.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"[Schema object](https://www.asyncapi.com/docs/reference/specification/v2.6.0#schemaObject)\n\\\n\\\n**Optional**. A Schema object containing the definitions for Anypoint MQ-specific headers (so-called protocol headers). This schema MUST be of type `object` and have a `properties` key. Examples of Anypoint MQ protocol headers are `messageId` and `messageGroupId`."},conditions:[{function:"missingField",params:["bindingVersion"]}]}],D5e=R5e,F5e=[...N5e,...D5e,{label:"bindingVersion",insertText:"bindingVersion",kind:14,format:QCe.QUOTED,type:GCe.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"**Optional**, defaults to `0.0.1`. The version of this binding."}},{target:"bindingVersion",label:"0.0.1",insertText:"0.0.1",kind:12,format:QCe.QUOTED_FORCED,type:GCe.VALUE,insertTextFormat:2}],k5e=F5e,j5e=[{target:"headers",docs:"[Schema object](https://www.asyncapi.com/docs/reference/specification/v2.6.0#schemaObject)\n\\\n\\\n**Optional**. A Schema object containing the definitions for Anypoint MQ-specific headers (so-called protocol headers). This schema MUST be of type `object` and have a `properties` key. Examples of Anypoint MQ protocol headers are `messageId` and `messageGroupId`."},{target:"bindingVersion",docs:"**Optional**, defaults to `0.0.1`. The version of this binding."},{docs:"#### [Message Binding Object](https://github.com/asyncapi/bindings/tree/master/anypointmq#message-binding-object)\n\nThe Anypoint MQ [Message Binding Object](https://github.com/asyncapi/spec/blob/master/spec/asyncapi.md#message-bindings-object) is defined by a [JSON Schema](https://github.com/asyncapi/bindings/blob/master/anypointmq/json_schemas/message.json), which defines these fields:\n\nField Name | Type | Description\n---|:---:|---\n`headers`               | [Schema Object](https://www.asyncapi.com/docs/reference/specification/v2.6.0#schemaObject) | **Optional**. A Schema object containing the definitions for Anypoint MQ-specific headers (so-called protocol headers). This schema MUST be of type `object` and have a `properties` key. Examples of Anypoint MQ protocol headers are `messageId` and `messageGroupId`.\n`bindingVersion` | string | **Optional**, defaults to `0.0.1`. The version of this binding.\n\nNote that application headers must be specified in the [`headers` field of the standard Message Object](https://github.com/asyncapi/spec/blob/master/spec/asyncapi.md#messageObjectHeaders) and are transmitted in the [`properties` section of the Anypoint MQ message](https://anypoint.mulesoft.com/exchange/portals/anypoint-platform/f1e97bc6-315a-4490-82a7-23abe036327a.anypoint-platform/anypoint-mq-broker/).\nIn contrast, protocol headers such as `messageId` must be specified in the [`headers` field of the message binding object](https://github.com/asyncapi/bindings/tree/master/anypointmq#messageBindingObjectHeaders) and are transmitted in the [`headers` section of the Anypoint MQ message](https://anypoint.mulesoft.com/exchange/portals/anypoint-platform/f1e97bc6-315a-4490-82a7-23abe036327a.anypoint-platform/anypoint-mq-broker/).\n\n### Examples\n\nThe following example shows a `channels` object with two channels, each having one operation (`subscribe` or `publish`) with one message. Only the message of the `subscribe` operation has a message binding object for `anypointmq`:\n\n\n\\\nYAML\n```yaml\nchannels:\n  user/signup:\n    publish:\n      message:\n        #...\n  user/signedup:\n    subscribe:\n      message:\n        headers:\n          type: object\n          properties:\n            correlationId:\n              description: Correlation ID set by application\n              type: string\n        payload:\n          type: object\n          properties:\n            #...\n        correlationId:\n          description: Correlation ID is specified as a header and transmitted in the Anypoint MQ message properties section\n          location:    $message.header#/correlationId\n        bindings:\n          anypointmq:\n            headers:\n              type: object\n              properties:\n                messageId:\n                  type: string\n            bindingVersion: '0.0.1'\n```"}],C5e={lint:x5e,completion:k5e,documentation:j5e},M5e=C5e,L5e={code:ULe.NOT_ALLOWED_FIELDS,source:"apilint",message:"This object MUST NOT contain any properties. Its name is reserved for future use.",severity:Jn.DiagnosticSeverity.Error,linterFunction:"allowedFields",linterParams:[[]],marker:"key",conditions:[{targets:[{path:"bindingVersion"}],function:"apilintValueOrArray",params:[["0.0.1"]]}]},U5e